import React from 'react';
import './DogProfileCard.css';

const DogProfileCard = ({ dog }) => {
  return (
    <div className="dog-profile-card">
      <img 
        src={dog.imageUrl}
        alt={dog.name}
        className="dog-profile-image"
      />
      <div className="dog-profile-info">
        <h2>{dog.name}, {dog.age}</h2>
        <p>{dog.breed} / {dog.gender}</p>
        <p className="dog-profile-bio">{dog.bio}</p>
      </div>
    </div>
  );
};

export default DogProfileCard;
